import React from "react";
import data from "../Data/data";

const UsersList = () => {
  return (
    <>
      <ul>
        {data.map((data) => (
          <li key={data.id}>
            {data.username} {data.password}
          </li>
        ))}
      </ul>
    </>
  );
};

export default UsersList;
